import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <Header className="Header"/>
    </div>
  );
}

function Header(){

  return(
    <>
     <div className="w3-bar w3-white w3-border-bottom w3-xlarge">
    </div>
    </>
  )
}

export default App;
